import React, { useState } from 'react';
import './App.css';

// Components
import {
  Container,
  Card,
  CardHeader,
  CardBody,
  Form,
  FormGroup,
  Label,
  Col,
  Input
} from 'reactstrap';

function App() {
  const [cpf, setCpf] = useState('');

  return (
    <Container style={{
      maxWidth: 900,
      margin: '0 auto',
      padding: '50px 0',
    }}>
      <Card>
        <CardHeader>
          <h1>CPF and CNPJ Mask</h1>
        </CardHeader>
        <CardBody>
          <Form>
            <FormGroup row>
              <Label for="cpf" sm={2}>CPF</Label>
              <Col sm={10}>
                <Input type="text" name="cpf" id="cpf" placeholder="Informe seu CPF" onChange={(e) => setCpf(e.target.value)} />
              </Col>
              <Label>{cpf}</Label>
            </FormGroup>
          </Form>
        </CardBody>
      </Card>
    </Container>
  );
}

export default App;
